{
  "title": "Título SEO optimizado",
  "meta_description": "Meta description de 150-160 caracteres",
  "slug": "url-slug-optimizado",
  "introduction": "<p>Introducción completa...</p>",
  "body_html": "<h2>Primera sección</h2><p>Contenido...</p>...",
  "faq": [
    {"question": "Pregunta 1", "answer": "Respuesta completa..."}
  ],
  "conclusion": "<p>Conclusión...</p>",
  "word_count": ${wordCount}
}`;

