// If $item is available (v1+):
const promptItems = $("Build SEO Prompt").all();

for (let i = 0; i < items.length; i++) {
    const item = items[i];
    // Get corresponding context item (assuming 1:1 match)
    const context = promptItems[i] ? promptItems[i].json : {};

