        const json = item.json;
        const rawText = json.text || 
                       (json.choices && json.choices[0] && json.choices[0].message && json.choices[0].message.content) || 
                       JSON.stringify(json); 

        let content = {};

        // Try parsing JSON block from AI
        const jsonMatch = rawText.match(/```json\n([\s\S]*?)\n```/) || rawText.match(/{[\s\S]*}/);
        if (jsonMatch) {
            try {
                content = JSON.parse(jsonMatch[1] || jsonMatch[0]);
            } catch (e) {
                content = { body_html: rawText };
            }
        } else {
            content = { body_html: rawText };
        }

        // Calculate Metrics
        // Use CONTEXT variables (from Build SEO Prompt) if not in new content
        const keyword = context.keyword || 'SEO';
        const fullText = (content.introduction || '') + (content.body_html || '') + (content.conclusion || '');
        const wordCount = content.word_count || (fullText.trim() === '' ? 0 : fullText.trim().split(/\s+/).length);
        const keywordCount = countOccurrences(fullText, keyword);
        const h2Count = (content.body_html || '').split('<h2').length - 1;
        const hasFAQ = (content.faq && content.faq.length > 0);

        let score = 0;
        if (wordCount >= 1500) score += 40;
        else if (wordCount >= 1000) score += 25;
        if (keywordCount >= 10) score += 20;
        if (h2Count >= 5) score += 20;
        if (hasFAQ) score += 20;
        if (score > 100) score = 100;

