            json: {
                ...context, // SPREAD CONTEXT (send_email, topic, keyword, etc)
                ai_response_metadata: json, // Keep AI metadata if needed
                generated_content: content,
                score: score,
                word_count: wordCount,
                keyword_density: wordCount > 0 ? ((keywordCount / wordCount) * 100).toFixed(2) : 0
            }
        });
    } catch (error) {
        results.push({ json: { ...item.json, error: error.message } });
    }
}

return results;

